import React from "react";

function Promo(props) {
    return (
        <div className="promo__container">
            <h1 className="promo__title">
            Учебный проект студента факультета Веб-разработки.
            </h1>
            <div className="nav">
                <ul className="nav__container">
                    <li className="nav__list"><button className="nav__container-button">О проекте</button></li>
                    <li className="nav__list"><button className="nav__container-button">Технологии</button></li>
                    <li className="nav__list"><button className="nav__container-button">Студент</button></li>
                </ul>
            </div>
        </div>

    );
}

export default Promo;
